import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import React from "react";
//import Navbar from "./Navbar";
import "./Login.css";


function Signin() {
    return (
        <>

            <div className="signup">
                <div className="row">

                    <div style={{textAlign:"center"}}>
                        <h3>SignIn</h3>
                    </div>
                    <div className="col-sm-12 col-md-12 col-lg-12 signupcon">
                        <input className="form-control" type="text" placeholder="Your Email" />
                    </div>

                    <div className="col-sm-12 col-md-6 col-lg-6 signupcon" >
                        <input className="form-control signupcon" type="text"  placeholder="Password" />
                    </div>

                    <div>
                    <button type="button" className="btn btn-outline-success">SignIn</button>
                    </div>
                </div>
            </div>
        </>
    );
}
export default Signin;
